private static boolean compareValues(TimelineCompareOp compareOp,
    long val1, long val2) {
  switch (compareOp) {
  case LESS_THAN:
    return val1 < val2;
  case LESS_OR_EQUAL:
    return val1 <= val2;
  case EQUAL:
    return val1 == val2;
  case NOT_EQUAL:
    return val1 != val2;
  case GREATER_OR_EQUAL:
    return val1 >= val2;
  case GREATER_THAN:
    return val1 > val2;
  default:
    throw new RuntimeException("Unknown TimelineCompareOp " +
        compareOp.name());
  }
}
